import React from 'react'
import {Link} from "react-router-dom"

const NotAuth = () => {
  return (
    <div>
      <h1>You are not authorized to view this page.</h1>
      <button className="hero_button_1"></button><Link className='Link notauth' to="/">Back to Home Page</Link><button/>
      <button className="hero_button_1"></button><Link className='Link notauth' to="/login">Login</Link><button/>
    </div>
  )
}

export default NotAuth
